import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import MainLayout from "./components/layout/MainLayout";
import AdminLayout from "./components/layout/AdminLayout";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<MainLayout />}>
          <Route index element={<h2>Home Page</h2>} />
          <Route path="search" element={<h2>Search Results</h2>} />
          <Route path="recipe/:id" element={<h2>Recipe Detail</h2>} />
          <Route path="create" element={<h2>Create Recipe</h2>} />
          <Route path="profile/:id" element={<h2>User Profile</h2>} />
        </Route>
        <Route path="/admin" element={<AdminLayout />}>
          <Route index element={<h2>Admin Dashboard</h2>} />
          <Route path="users" element={<h2>User Management</h2>} />
          <Route path="content" element={<h2>Content Moderation</h2>} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
